struct CustomError(String); fn main() -> Result<(), CustomError> { let path = "test.txt"; let content = std::fs::read_to_string(path) .map_err(|err| CustomError(format!("Error reading `{}`: {}", path, err)))?; println!("file content: {}", content); Ok(())
} 이제 이것을 실행하면 사용자 지정 오류 메시지가 표시됩니다. Error: CustomError("Error reading `test.txt`: No such file or directory (os error 2)") 별로 예쁘지는 않지만 나중에 우리 유형에 대한 디버그 출력을 쉽게 조정할 수 있습니다. 이 패턴은 실제로 매우 일반적입니다. 하지만 한 가지 문제가 있습니다. 원래 오류는 저장하지 않고 문자열 표현만 저장합니다. 자주 사용되는 anyhow 라이브러리에는 이에 대한 깔끔한 해결책이 있습니다. CustomError 유형과 유사하게 Context 특성을 사용하여 설명을 추가할 수 있습니다. 또한 원래 오류도 유지하므로 근본 원인을 지적하는 오류 메시지의 "체인"을 얻을 수 있습니다. 먼저 Cargo.toml 파일의 [dependencies] 섹션에 anyhow = "1.0"을 추가하여 anyhow 크레이트를 가져옵니다. 전체 예제는 다음과 같습니다. use anyhow::{Context, Result}; fn main() -> Result<()> { let path = "test.txt"; let content = std::fs::read_to_string(path) .with_context(|| format!("could not read file `{}`", path))?; println!("file content: {}", content); Ok(())
} 오류가 인쇄됩니다. Error: could not read file `test.txt` Caused by: No such file or directory (os error 2)

