기능을 테스트하는 데는 두 가지 보완적인 접근 방식이 있습니다. 완전한 응용 프로그램을 구성하는 작은 단위를 테스트하는 것을 "단위 테스트"라고 합니다. 최종 응용 프로그램을 "외부에서" 테스트하는 것을 "블랙박스 테스트" 또는 "통합 테스트"라고도 합니다. 첫 번째부터 시작하겠습니다. 무엇을 테스트해야 하는지 알아보기 위해 프로그램 기능이 무엇인지 살펴보겠습니다. 주로 grrs는 주어진 패턴과 일치하는 줄을 인쇄해야 합니다. 따라서 _정확히 이것_에 대한 단위 테스트를 작성해 봅시다. 가장 중요한 로직이 작동하는지 확인하고 싶고, 주변에 있는 설정 코드(예: CLI 인수 처리)에 의존하지 않는 방식으로 수행하고 싶습니다. grrs의 첫 번째 구현 으로 돌아가서 main 함수에 이 코드 블록을 추가했습니다. // ...
for line in content.lines() { if line.contains(&args.pattern) { println!("{}", line); }
} 안타깝게도 이것은 테스트하기가 쉽지 않습니다. 우선, main 함수에 있으므로 쉽게 호출할 수 없습니다. 이 코드 조각을 함수로 옮기면 쉽게 해결할 수 있습니다. fn find_matches(content: &str, pattern: &str) { for line in content.lines() { if line.contains(pattern) { println!("{}", line); } }
} 이제 테스트에서 이 함수를 호출하고 출력이 무엇인지 확인할 수 있습니다. #[test]
fn find_a_match() { find_matches("lorem ipsum\ndolor sit amet", "lorem"); assert_eq!( // 어... 아니면... 할 수 있을까요? 지금 find_matches는 stdout, 즉 터미널에 직접 인쇄합니다. 테스트에서 이것을 쉽게 캡처할 수 없습니다! 이것은 구현 후에 테스트를 작성할 때 종종 발생하는 문제입니다. 우리는 사용되는 컨텍스트에 확고하게 통합된 함수를 작성했습니다. 참고: 이것은 작은 CLI 응용 프로그램을 작성할 때 완전히 괜찮습니다. 모든 것을 테스트 가능하게 만들 필요는 없습니다! 그러나 코드의 어떤 부분에 대해 단위 테스트를 작성하고 싶은지 생각하는 것이 중요합니다. 이 함수를 테스트 가능하게 변경하는 것이 쉽다는 것을 알게 되겠지만 항상 그런 것은 아닙니다. 좋습니다, 어떻게 테스트 가능하게 만들 수 있을까요? 어떻게든 출력을 캡처해야 합니다. Rust의 표준 라이브러리에는 I/O(입력/출력)를 처리하기 위한 몇 가지 깔끔한 추상화가 있으며 std::io::Write 라는 것을 사용할 것입니다. 이것은 문자열뿐만 아니라 stdout도 포함하여 우리가 쓸 수 있는 것들을 추상화하는 특성 입니다. Rust의 맥락에서 "특성"이라는 말을 처음 들어본다면, 당신은 운이 좋습니다. 특성은 Rust의 가장 강력한 기능 중 하나입니다. Java의 인터페이스나 Haskell의 유형 클래스(어느 쪽이 더 익숙하든)와 같다고 생각할 수 있습니다. 이를 통해 다른 유형에서 공유할 수 있는 동작을 추상화할 수 있습니다. 특성을 사용하는 코드는 매우 일반적이고 유연한 방식으로 아이디어를 표현할 수 있습니다. 하지만 이것은 읽기 어려워질 수도 있다는 것을 의미합니다. 겁먹지 마세요. 수년 동안 Rust를 사용해 온 사람들조차도 제네릭 코드가 즉시 무엇을 하는지 항상 이해하지는 못합니다. 이 경우 구체적인 용도를 생각하는 것이 도움이 됩니다. 예를 들어, 우리의 경우 추상화하는 동작은 "쓰기"입니다. 이를 구현하는( "impl") 유형의 예로는 터미널의 표준 출력, 파일, 메모리의 버퍼 또는 TCP 네트워크 연결이 있습니다. ( std::io::Write에 대한 문서 에서 "구현자" 목록을 보려면 아래로 스크롤하세요.) 그 지식을 바탕으로 함수가 세 번째 매개변수를 받도록 변경해 봅시다. Write를 구현하는 모든 유형이어야 합니다. 이렇게 하면 테스트에서 간단한 문자열을 제공하고 이에 대한 어설션을 만들 수 있습니다. 다음은 이 버전의 find_matches를 작성하는 방법입니다. fn find_matches(content: &str, pattern: &str, mut writer: impl std::io::Write) { for line in content.lines() { if line.contains(pattern) { writeln!(writer, "{}", line); } }
} 새 매개변수는 mut writer, 즉 "writer"라고 부르는 변경 가능한 것입니다. 유형은 impl std::io::Write이며, 이는 "Write 특성을 구현하는 모든 유형에 대한 자리 표시자"로 읽을 수 있습니다. 또한 이전에 사용했던 println!(…)을 writeln!(writer, …)으로 바꾼 방법도 주목하세요. println!은 writeln!과 동일하게 작동하지만 항상 표준 출력을 사용합니다. 이제 출력을 테스트할 수 있습니다. #[test]
fn find_a_match() { let mut result = Vec::new(); find_matches("lorem ipsum\ndolor sit amet", "lorem", &mut result); assert_eq!(result, b"lorem ipsum\n");
} 이제 응용 프로그램 코드에서 이것을 사용하려면 main에서 find_matches에 대한 호출을 세 번째 매개변수로 &mut std::io::stdout() 을 추가하여 변경해야 합니다. 다음은 이전 장에서 본 내용을 기반으로 하고 추출된 find_matches 함수를 사용하는 main 함수의 예입니다. fn main() -> Result<()> { let args = Cli::parse(); let content = std::fs::read_to_string(&args.path) .with_context(|| format!("could not read file `{}`", args.path.display()))?; find_matches(&content, &args.pattern, &mut std::io::stdout()); Ok(())
