CLI의 문서는 일반적으로 명령의 --help 섹션과 매뉴얼(man) 페이지로 구성됩니다. 둘 다 clap 을 사용할 때 clap_mangen 크레이트를 통해 자동으로 생성될 수 있습니다. #[derive(Parser)]
pub struct Head { /// 로드할 파일 pub file: PathBuf, /// 인쇄할 줄 수 #[arg(short = "n", default_value = "5")] pub count: usize,
} 둘째, 코드로 앱을 정의한 후 컴파일 시간에 매뉴얼 파일을 생성하기 위해 build.rs를 사용해야 합니다. 명심해야 할 몇 가지 사항이 있습니다(바이너리를 패키징하는 방법 등). 하지만 지금은 man 파일을 src 폴더 옆에 두겠습니다. use clap::CommandFactory; #[path="src/cli.rs"]
mod cli; fn main() -> std::io::Result<()> { let out_dir = std::path::PathBuf::from(std::env::var_os("OUT_DIR").ok_or_else(|| std::io::ErrorKind::NotFound)?); let cmd = cli::Head::command(); let man = clap_mangen::Man::new(cmd); let mut buffer: Vec<u8> = Default::default(); man.render(&mut buffer)?; std::fs::write(out_dir.join("head.1"), buffer)?; Ok(())
} 이제 응용 프로그램을 컴파일하면 프로젝트 디렉토리에 head.1 파일이 생성됩니다. man에서 열면 무료 문서를 감상할 수 있습니다.

