더 좋은 방법은 사용 가능한 많은 라이브러리 중 하나를 사용하는 것입니다. 명령줄 인수를 구문 분석하는 가장 인기 있는 라이브러리는 clap 입니다. 하위 명령, 셸 완성 및 훌륭한 도움말 메시지를 포함하여 기대하는 모든 기능을 갖추고 있습니다. 먼저 Cargo.toml 파일의 [dependencies] 섹션에 clap = { version = "4.0", features = ["derive"] }를 추가하여 clap을 가져옵니다. 이제 코드에 use clap::Parser;를 작성하고 struct Cli 바로 위에 #[derive(Parser)]를 추가할 수 있습니다. 그 과정에서 몇 가지 문서 주석도 작성해 봅시다. 다음과 같이 보일 것입니다(src/main.rs 파일에서 fn main() { 이전). use clap::Parser; /// 파일에서 패턴을 검색하고 해당 패턴을 포함하는 줄을 표시합니다.
#[derive(Parser)]
struct Cli { /// 찾을 패턴 pattern: String, /// 읽을 파일의 경로 path: std::path::PathBuf,
} 참고: 필드에 추가할 수 있는 사용자 지정 속성이 많이 있습니다. 예를 들어 -o 또는 --output 뒤의 인수에 이 필드를 사용하려면 #[arg(short = 'o', long = "output")]를 추가합니다. 자세한 내용은 clap 문서 를 참조하세요. Cli 구조체 바로 아래에 템플릿에 main 함수가 포함되어 있습니다. 프로그램이 시작되면 이 함수를 호출합니다. fn main() { let args = Cli::parse(); println!("pattern: {:?}, path: {:?}", args.pattern, args.path)
} 이렇게 하면 인수를 Cli 구조체로 구문 분석하려고 시도합니다. 하지만 실패하면 어떻게 될까요? 이것이 이 접근 방식의 장점입니다. Clap은 어떤 필드를 예상해야 하는지, 그리고 예상 형식이 무엇인지 알고 있습니다. --help 메시지를 자동으로 생성하고 --putput을 작성했을 때 --output을 전달하도록 제안하는 훌륭한 오류를 제공할 수 있습니다. 참고: parse 메서드는 main 함수에서 사용하기 위한 것입니다. 실패하면 오류 또는 도움말 메시지를 인쇄하고 즉시 프로그램을 종료합니다. 다른 곳에서는 사용하지 마세요!
